import './App.css';
import Navbar from './components/Navbar/Navbar'
import Home from './components/Home/Home';
import Footer from './components/Footer/Footer';
import { Link, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Home />
      </Routes>

      <Footer />
    </div>
  );
}

export default App;
